import React from "react";
import { 
    MDBCard,
    MDBCardBody,
    MDBContainer,
    MDBRow,
    MDBCol,
 } from "mdb-react-ui-kit";
 import "./style.css";
import { TableSection } from "./Components/tableSection";
export function Trello() {

    const  dataForDream =  [<ProfileCard />,<ProfileCard />,<ProfileCard />]
    const dataForBest = [<ProfileCard />,<ProfileCard />,<ProfileCard />]

    const trello = {
       arrayTitle : ["Dream", "Best", "Good", "Intermediate", "Evil"],
       arrayData: [dataForDream, dataForBest]
    }





    return(
        <>  
            <div className="trello-container">
                <MDBRow className="trello-content">
                    {
                        trello.map((titles, i) => {
                            return (
                                <MDBCol key={i} >
                                    <TableSection tableTitle={titles.arrayTitle} data={titles.arrayData}></TableSection>
                                </MDBCol>
                            )
                        })
                    }
                </MDBRow>
            </div>
        </>



    )
}
